        <div className="card-container text-center p-2 bg-zinc-800 rounded-[1rem]">
            <div className="image-container h-[20vw]">
                <img className="rounded-[1rem]" src={Cards} alt="" />
            </div>
            <div className="title-container">
                <span>Get diet and fitness tips in your inbox</span>
            </div>
            <div className="description-container">
                <p>Eat better and exercise better. Signup for the Diet&Fitness newsletter.</p>
            </div>
            <div className="email-container">
            <input type="text" id="fname" name="firstname" placeholder="Your name.." />
            </div>
            <a href="" className="btn subcribe-btn"> Subcribe</a>
        </div>

     );
}

export default Card;
